import React from 'react';
import './Arrow.css';
import { HiArrowLeft } from 'react-icons/hi';
import Media from 'react-media';
import { useNavigate } from 'react-router-dom';
import { TweenMax, Expo } from 'gsap';

// REturn Arrow component 
export default function REturnArroW() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};

export const ScreenLarge = () => {
 return (
  <div className='wrp-arrow-add-money'>
   <Arrow />
  </div>
 )
};
export const ScreenSmall = () => {
 return (
  <div className='wrp-arrow-add-money-sm'>
   <Arrow />
  </div>
 )
}
export const Arrow = () => {

 React.useEffect(() => {
  TweenMax.from('.wrp-arrow-add-money .wrp-icon', 1.2, { delay: .5, opacity: 0, x: 20, ease: Expo.easeIn })
 }, []);

 const navigation = useNavigate();
 const handlebackpath = (event) => {
  event.preventDefault();
  navigation(-1);
 }

 return (
  <div onClick={handlebackpath} className='wrp-icon'>
   <HiArrowLeft size={'1.8em'} />
  </div>
 );
};
